import React from "react";
import "./style.css";
import "../../box-style.css";

export default function Footer() {
  return (
    <div id="footer-container">
      <div id="footer-box">
        <h1 id="footer-h1">
         This is a footer
        </h1>
      </div>
    </div>
  );
}
